import React, { Component } from "react";
import linkedIn from './linkedin2.png';
import github from './githubicon.jpg';


class Contact extends Component {
  render() {
    return (
      <div>
        <img src={github} className="icons"></img>
      </div>
    );
  }
}

export default Contact;
